// Generated by CoffeeScript 2.4.1
(function() {
  netuno.addPageLoad(function() {
    $('#formSignIn').on('submit', function(e) {
      e.preventDefault();
      return $.ajax({
        type: 'POST',
        url: `${netuno.config.urlAdmin}Index${netuno.config.extension}?action=login`,
        data: {
          'username': $("#inputUserName").val(),
          'password': $("#inputPassword").val()
        },
        success: function(response) {
          return $('#login_result').html(response);
        }
      });
    });
    if ($('#formSignIn').is('[netuno-login-auto="true"]')) {
      return $('#formSignIn').trigger('submit');
    }
  });

}).call(this);
